descr_pedido:
Microfone: Sem Fio de Mao Duplo; 2 Transmissores Pg2 de Mão
Leds: Indicadores de Ligado, Mudo, Carga de Bateria;
Constituído De: Chave Liga/desliga e Chave Mute; 
Faixa de Operação: de Até 75 M
Capsulas: 02 (duas) Capsulas para Microfone Sem Fio; 
Capsulas: Completa Compatível Com Sistemas Sem Fio, Já Incluso o Globo;
Receptor Duplo: 01 (um) Receptor Duplo, com até 08 (oito) Sistemas Compatíveis; 
Saídas: de Áudio P10/xlr;
Antena: Interna Controlada Por Microprocessador;
Impedância: de saída de 200 Ohms para Conector Xlr e 1 k Ohm para Conector P10;
Nível de Saída: de Áudio para Carga de 100 k Ohm: 19 Dbv para Xlr e 5 Dbv para P10; 
Sensibilidade: de 105 Dbm para 12 Db de Sinad;
Imagem de Rejeição: Maior Que 50 Db;
Acessórios: 02 (duas) Pilhas Tamanho Aa Permitindo 2 Horas de Uso Continuo; 
Corpo: de ABS Moldado;
Alimentação: Por Fonte Externa Homologada Pela Anatel; Corrente de 320 Ma.
Medindo aproximadamente: 388 x 116 x 40 Mm (l x p x A); 
Pesando no máximo: 429 G;

Projetor de multimídia: com no mínimo 3100 lumens; Resolução: 1280 x 800 pixels; Contraste: de no mínimo 15000:1; Tecnologia: de produção DLP/3LCD; 
Zoom: manual de aproximadamente 1,2x; 
Foco: manual; Projeção: de tela mínima de 30 a 320 polegadas; Compatível: com sinais de vídeo NTSC, PAL, SECAM;
Correção: efeito trapézio vertical de no mínimo +/- 20 graus; com ruído máximo de 37dB; Conexões: de entrada/saída VGA, áudio, vídeo composto (RCA), HDMI, USB; 
Alimentação: voltagem bivolt, 50 a 60hz de frequência, pesando no máximo 4,0 kg; Medida: medindo aproximadamente 32 x 24 x 10 cm (L X P X A);
Modo de projeção: frontal, traseira e teto, lâmpada com duração de no mínimo 10000 horas no modo econômico; 
Fornecimento acessórios: com lâmpada de substituição, controle remoto, cabo de alimentação, cabo de computador (VGA);

