Carro de transporte manual, para cozinha, com 02 planos liso, de aço inox aisi 304 chapas 20, para transporte de gn's (cubas) ou bandejas, modelo aberto, com alça tubular de 11/4, com proteção lateral, medindo aproximadamente (90 x 60 x 90) cm.

1.1. Dimensões e tolerâncias mínimas 
Dimensões externas: 
	Comprimento máximo: 0,90 m; 
	Profundidade máximo: 0,65 m considerando corre bandejas de ambos os lados); 
	Altura: 0,85 m. 
1.2. Características construtivas 
	Estrutura tubular com cantoneiras de reforço em chapa de aço INOX ANSI 304; 
	Trilhos de inserção e remoção das cubas; 
	Com ou sem tampo superior em chapa de aço INOX ANSI 304; 
	4 rodízios de 4 giratórios, preferencialmente 2 com travas de segurança. 

1.3. Matérias-primas, tratamentos e acabamentos 
	Toda parte estrutural, chaparia e elementos de fixação devem ser confeccionadas em aço INOX ANSI 304;
	Os rodízios devem ser confeccionados em material polimérico de alta resistência; 
	Acabamento das soldas deve ser invisíveis com polimento fosco.

Ferro elétrico industrial; com estrutura e base em alumínio; cabo em nylon; a vapor, automático; com fio elétrico hpn antichamas; reservatório de agua
 externo com 5 litros de capacidade; na voltagem de 220v; potencia mínima de 1200w; dimensão aproximada de (12 x 24)cm (comprimento x profundidade); peso aproximado de 2kg; acompanhado por mangueira de silicone e descanso de silicone; com termostato e luz piloto,
 manual de instruções; acondicionado em embalagem apropriada, de forma a garantir a integridade do produto; garantia mínima de 12 meses;

